import { Button, Nav, Navbar, Container, Row, Col, Form } from 'react-bootstrap';
import './loader.css'
function Tag() {

    return ( <>

        <Container className="container-loader">
           <Form>
      <Row>
    <Col xs={7}>
      <Form.Control placeholder="User can enter tags to be crawled" />
    </Col>
    <Col>
    <Button variant="flat" size="xxl"> Crawl Tags</Button>
    </Col>
  </Row>
</Form> 
        </Container>
</>
    );
}

export default Tag;
